    <div>
      <Row>
        <Col>
        <div className='landingbody-maindiv'>
            <span className='span1'>vehicle maintainence from the comfort of your home</span>
            <span>open auto soothes the hassle of maintaining your vehicle and helps you deal with unexpected repairs worry free. </span>
